        }

        /* Card Flip Effect */
       .flip-container {
            perspective: 800px;
            position: relative;
        }

       .flipper {
            transition: transform 0.6s;
            transform-style: preserve-3d;
            position: relative;
        }

       .front,.back {
            backface-visibility: hidden;
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            padding: 20px;
            border-radius: 10px;
            overflow: hidden;
        }

       .front {
            transform: rotateY(0deg);
        }

       .back {
            transform: rotateY(180deg);
        }

       .flip-container:hover.flipper {
            transform: rotateY(180deg);
        }
    </style>
</head>

